
--Unified security map, utilizes integer offset to combine NA and Global sec maps
IF  EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'trqa.AllSecMapX'))
DROP VIEW trqa.AllSecMapX
GO

CREATE VIEW trqa.AllSecMapX AS

	SELECT map.seccode, map.ventype, map.vencode, map.rank,
		CASE WHEN map.exchange = 1 THEN 'US'
			 WHEN map.exchange = 2 THEN 'CA'
			 ELSE 'N/A'
			 END AS CtryTradedIn,
		map.startdate, map.enddate, a.minrank
	 FROM dbo.SecMapX map
	 inner join
		(select min(Rank) as minrank, map.ventype, map.seccode, map.exchange
			from dbo.secmapx map
			group by map.seccode, map.ventype, map.exchange) a
		ON map.ventype = a.ventype
		AND map.seccode = a.seccode
		AND map.exchange = a.exchange

	UNION ALL

	SELECT
			gmap.seccode + 100000000
		,	gmap.ventype
		,	gmap.vencode
		,	gmap.rank
		,	'G' AS CtryTradedIn
		,	gmap.startdate
		,	gmap.enddate
		,	b.minrank
	 FROM dbo.GSecMapX gmap
	 INNER JOIN
		(SELECT min(Rank) AS minrank, gmap.ventype, gmap.seccode, gmap.exchange
			from dbo.gsecmapx gmap
			group by gmap.seccode, gmap.ventype, gmap.exchange) b
		ON	gmap.ventype = b.ventype
		AND gmap.seccode = b.seccode
		AND gmap.exchange = b.exchange
GO

--unified security master built around ds2
IF  EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'trqa.Ds2EqMstr'))
DROP VIEW trqa.Ds2EqMstr
GO

CREATE VIEW trqa.Ds2EqMstr AS
    SELECT
            ds.infocode
        ,	ds.ISOCurrCode
        ,	ds.IsPrimExchQt
        ,	exch.ExchIntCode
        ,	exch.ExchCtryCode as CtryTradedIn
        ,	ds2ctry.StatusCode	--(A)ctive, (D)ead, (S)uspended
        ,	ds2ctry.TypeCode
        ,	map.seccode as seccode
        ,	ds2comp.cmpyctrycode as CtryOfIssuer
    FROM dbo.ds2exchqtinfo ds
    INNER JOIN dbo.ds2exchange exch
        ON ds.exchintcode = exch.exchintcode
    INNER JOIN dbo.ds2ctryqtinfo ds2ctry
        ON ds.infocode = ds2ctry.infocode
    INNER JOIN dbo.ds2Security ds2sec
        ON ds2sec.dsseccode = ds2ctry.dsseccode
    INNER JOIN dbo.ds2company ds2comp
        ON ds2comp.dscmpycode = ds2sec.dscmpycode
    LEFT JOIN trqa.AllSecMapX map
        ON ds.infocode = map.vencode
        AND map.ventype = 33

    WHERE
        map.seccode IS NOT NULL
GO

--unified security map to be used with ds2eqmstr
IF  EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'trqa.ds2secmapx'))
DROP VIEW trqa.ds2secmapx
GO

CREATE VIEW trqa.ds2secmapx AS
      SELECT
            ds.infocode
        ,	ds.IsPrimExchQt
        ,	ds.CtryTradedIn
        ,	ds.ExchIntCode
        ,	ds.seccode
        ,	map.ventype
        ,	map.vencode
        ,	map.rank
        ,	map.minrank
        ,	map.startdate
        ,	map.enddate

        FROM trqa.ds2eqmstr ds
        JOIN trqa.allsecmapx map
            ON	map.seccode = ds.seccode
            AND ds.isprimexchqt = 'y'
            AND ds.ctrytradedin = map.ctrytradedin

GO

--Country Code Map
IF OBJECT_ID('trqa.CountryCodeMap', 'U') IS NOT NULL
  DROP TABLE trqa.CountryCodeMap
GO

Create Table trqa.CountryCodeMap
(
	Name		varchar(50),
	GEC			varchar(2),
	ISO3166_2	varchar(2) NOT NULL PRIMARY KEY,
	ISO3166_3	varchar(3),
	ISO3166_1	int,
	STANAG		varchar(3)
)

CREATE NONCLUSTERED INDEX ISO3166_3_ix ON trqa.CountryCodeMap (ISO3166_3) INCLUDE (ISO3166_2, ISO3166_1);


GO

--MICS map
IF OBJECT_ID('trqa.mics', 'U') IS NOT NULL
  DROP TABLE trqa.mics
GO

Create Table trqa.mics
(
	MIC			varchar(4) NOT NULL PRIMARY KEY,
	ISO3166_2	varchar(2),
	Name		varchar(100),
	Acronym		varchar(20)
)


